export default () => {
  return (
    <style jsx>
    {`
      .github-icon {
        margin-right: 16px;
        line-height: 1;
        width: 32px;
        height: 32px;
      }
      .link {
        color: #fff;
        font-size: 32px;
        box-sizing: border-box;
        position: relative;
        top: -1px;
      }
    `}
    </style>
  )
}
